import React from "react";
import { useNavigate } from "react-router-dom";
import Buttons from "./Buttons";


const Home = () => {

    const navigate = useNavigate();

    const handleClick = () => {
        const LinkTo = '/easy';
        navigate(LinkTo);

    }

    return (
        <>
        <div className="home">
           <h2>pocetak</h2>
           <div className="buttons" ></div>
       <Buttons />
            </div></>
    )

}
export default Home;
